import React from 'react';

function Test02({ onChange }) {
    const handleInputChange = (event) => {
        const { value } = event.target;
        onChange(value);
    };

    return (
        <div>
            <input type="text" onChange={handleInputChange} />
        </div>
    );
}

export default Test02;
